    <div className="contshethik">
        <button onClick={()=>{dispatch({type:saronit,payload:value+1})}}>+</button>
        <p>{value}</p>
        <button onClick={()=>{dispatch({type:saronit,payload:value-1})}}>-</button>
    </div>
  )
}
